import './App.css';
import './components/bst';
import { Button } from 'react-native';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Car Information Analyzer
        </p>
        <a
          className="App-link"
          href="https://vpic.nhtsa.dot.gov/api/"
          target="_blank"
          rel="noopener noreferrer"
        >
          Data Source
        </a>
        <Button title="BST" onClick={bst}></Button>
      </header>
    </div>
  );
}

export default App;
